import QuoteList from './components/quotes/QuoteList';

const DUMMY_QUOTES = [
    { id: 'q1', author:'Ansh', text:'Learning React is fun!'},
    { id: 'q2', author:'Max', text:'Learning Python is fun!'},
]



function AllQuotes() {
    return <QuoteList quotes={DUMMY_QUOTES}></QuoteList>
}

export default AllQuotes;
